import React, { Component } from 'react'
import Base from '../layout/Base'
import Head from 'next/head'

export default class extends Component{
    render(){
        return(
            <Base>
                <Head>
                    <title>AppdelanteMovies</title>
                </Head>
            </Base>
        );
    }
}
